// src/screen/Register.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Register.css';

function Register({ handleLoginClick }) {
  const navigate = useNavigate(); // Hook de navegaci贸n

  const handleRegisterSubmit = (event) => {
    event.preventDefault();
    // L贸gica de registro, si es exitosa redirigir a Home
    navigate('/home');
  };

  return (
    <div className="register-container">
      <h2>Register</h2>
      <form onSubmit={handleRegisterSubmit}>
        <input type="text" placeholder="Username" required />
        <input type="email" placeholder="Email" required />
        <input type="password" placeholder="Password" required />
        <button type="submit">Register</button>
      </form>
      <p>Already have an account? <a href="#" onClick={handleLoginClick}>Login</a></p>
    </div>
  );
}

export default Register;
